This is literally the cutest animal I’ve ever seen. I shared in my story that I changed her name to Squiggle (Squig), she was not a Mooshie. She is the sweetest, cuddliest, funniest animal I’ve ever had and it’s only just the beginning. Her personality will grow as she grows. My older one (Renn) is coming around, the smell of Squig isn’t pissing her off as much as it originally was 😂 Renn is so funny, she will unwrap my robe with those little hands and pull it open to smell my bra because Squig lays on my chest a lot. Renn looks for reasons to be pissed about it sometimes, she’s so dramatic 😂 I had a hell of a time finding a vet for her. Everybody I called said they don’t see rabies vector species. To every one of them I said “oh so you don’t see cats and dogs either”. A vector species means they are carriers of rabies. Cats and dogs are too. I don’t get why raccoons are singled out. All dog owners don’t vaccinate their dogs and leave their dogs outside unattended. People let their cats outside because they say “they want to be out” but don’t vaccinate. So there are plenty of opportunities for cats and dogs to get rabies and yet they are treated so differently than raccoons. And a dog or cat will bite just as easily as wildlife if they feel threatened. Raccoons aren’t a special case. Obviously you can tell this all hits a nerve for me 😂
